export function add50(a: number, b: number): number {
  return a + b;
}

export function subtract50(a: number, b: number): number {
  return a - b;
}

export function multiply50(a: number, b: number): number {
  return a * b;
}

export function divide50(a: number, b: number): number {
  return a / b;
}
